El poema "Revolución" fue escrito por Manuel del Palacio (1831-1906), poeta, periodista y satírico español que vivió durante el siglo XIX. Fue un autor representativo del Romanticismo tardío español y destacó tanto por su poesía seria como por sus composiciones satíricas y humorísticas.
